import React, { Component } from 'react';

class Detail extends Component {

	constructor(props) {
		super(props);
		this.state={
			title: 'title',
			content: 'content'
		}
	}

	render() {
		return(
			<div>{this.props.match.params.id}</div>
		)
	}
}

export default Detail;
